fined','1'),(1201,222,NULL,'2020-03-16 12:26:35','presence','join','adaasadadass','undefined:undefined','1'),(1202,222,NULL,'2020-03-16 12:37:59','presence','leave','adaasadadass','undefined:undefined','1'),(1203,191,NULL,'2020-03-16 12:37:59','presence','leave','adaasadadass','undefined:undefined','1'),(1204,247,NULL,'2020-03-16 12:37:59','presence','leave','user3','undefined:undefined','1'),(1205,191,NULL,'2020-03-16 13:44:00','presence','join','adaasadadass','undefined:undefined','1'),(1206,247,NULL,'2020-03-16 13:44:00','presence','join','user3','undefined:undefined','1'),(1207,222,NULL,'2020-03-16 13:44:00','presence','join','adaasadadass','undefined:undefined','1'),(1208,191,NULL,'2020-03-16 13:47:29','presence','leave','adaasadadass','undefined:undefined','1'),(1209,247,NULL,'2020-03-16 13:47:29','presence','leave','user3','undefined:undefined','1'),(1210,191,NULL,'2020-03-16 13:47:31','presence','join','adaasadadass','undefined:undefined','1'),(1211,247,NULL,'2020-03-16 13:47:31','presence','join','user3','undefined:undefined','1'),(1212,410,NULL,'2020-03-16 15:05:51','presence','join','viki','undefined:undefined','1'),(1213,410,NULL,'2020-03-16 15:05:52','presence','join','Rebo4AI','undefined:undefined','1'),(1214,410,NULL,'2020-03-16 15:05:53','text','Hi, I\'m Rebo4AI; a prototype conversational agent. With me, you can currently discuss only about intelligence. Is that OK with you; do you want to start a conversation?','Rebo4AI','undefined:undefined','1'),(1215,410,NULL,'2020-03-16 15:06:00','text','yes, that would be lovely!','viki','undefined:undefined','1'),(1216,410,NULL,'2020-03-16 15:06:01','text','In the TUGraz lecture \"<i>Introduction to Data Science and Artificial Intelligence (IDSA)</i>\", different definitions of intelligence have been discussed. According to different definitions, something or someone would be called intelligent if it <b>thinks humanly</b>, <b>acts humanly</b>, <b>thinks rationally</b>, <b>acts rationally</b>; or if it is <b>able to adapt behaviour</b> to a changing environment in order to achieve its goals.','Rebo4AI','undefined:undefined','1'),(1217,410,NULL,'2020-03-16 15:06:01','text','I have this information from <a href=\"http://rebo4ai.know-center.tugraz.at/bazaar/data/IDSAI/1a_Introduction.pdf\" download=\"http://rebo4ai.know-center.tugraz.at/bazaar/data/IDSAI/1a_Introduction.pdf\">here</a>. But, I\'m not sure I completely understand.','Rebo4AI','undefined:undefined','1'),(1218,410,NULL,'2020-03-16 15:06:01','text','I\'m curious: Is a typical car now intelligent or not? Why?','Rebo4AI','undefined:undefined','1'),(1219,410,NULL,'2020-03-16 15:06:30','text','hm. my car is probably not intelligent....','viki','undefined:undefined','1'),(1220,410,NULL,'2020-03-16 15:07:49','text','it certainly doesn&#39;t think or act humanly...\nit acts rationally. \nit probably thinks rationally, but in a very limited manner. \ni&#39;m told, it isn&#39;t (yet) based on a lot of software - it&#39;s a year 2000.\nand it absolutely isn&#39;t able to adapt _its_ behaviour. it doesn&#39;t have goals. and it&#39;s actually _my_ behaviour that the car mostly shows. \nexcept when the light goes out when it shouldn&#39;t...\nso no. it&#39;s not intelligent.','viki','undefined:undefined','1'),(1221,410,NULL,'2020-03-16 15:07:53','text','Are you personally satisfied with this decision and definition?','Rebo4AI','undefined:undefined','1'),(1222,410,NULL,'2020-03-16 15:08:10','text','yes.','viki','undefined:undefined','1'),(1223,410,NULL,'2020-03-16 15:08:15','text','Good to hear that!','Rebo4AI','undefined:undefined','1'),(1224,410,NULL,'2020-03-16 15:08:15','text','How interesting is it for you to know whether a typical car is intelligent or not?','Rebo4AI','undefined:undefined','1'),(1225,410,NULL,'2020-03-16 15:08:57','text','i wouldn&#39;t have thought it&#39;s important. but on the other hand - i realise that a car is one of those things where I would appreciate if they were a bit more intelligent; AND had the goal not to crash &#x2F; not to kill anyone.','viki','undefined:undefined','1'),(1226,410,NULL,'2020-03-16 15:09:01','text','What in your life would change, depending on whether you see a typical car as intelligent or not?','Rebo4AI','undefined:undefined','1'),(1227,410,NULL,'2020-03-16 15:09:15','text','and particularly actually this ability to adapt behaviour would be cool...','viki','undefined:undefined','1'),(1228,410,NULL,'2020-03-16 15:09:37','text','hm. what in my life would change - i think, hope, that with more intelligent cars there would be fewer casualties in traffic.','viki','undefined:undefined','1'),(1229,410,NULL,'2020-03-16 15:09:42','presence','leave','Rebo4AI','undefined:undefined','1'),(1230,191,NULL,'2020-03-16 15:26:00','presence','leave','adaasadadass','undefined:undefined','1'),(1231,247,NULL,'2020-03-16 15:26:00','presence','leave','user3','undefined:undefined','1'),(1232,222,NULL,'2020-03-16 15:26:00','presence','leave','adaasadadass','undefined:undefined','1'),(1233,247,NULL,'2020-03-16 15:26:24','presence','join','user3','undefined:undefined','1'),(1234,222,NULL,'2020-03-16 15:26:25','presence','join','adaasadadass','undefined:undefined','1'),(1235,191,NULL,'2020-03-16 15:26:25','presence','join','adaasadadass','undefined:undefined','1'),(1236,247,NULL,'2020-03-16 15:27:08','presence','leave','user3','undefined:undefined','1'),(1237,191,NULL,'2020-03-16 15:27:08','presence','leave','adaasadadass','undefined:undefined','1'),(1238,222,NULL,'2020-03-16 15:27:17','presence','leave','adaasadadass','undefined:undefined','1'),(1239,247,NULL,'2020-03-16 15:27:41','presence','join','user3','undefined:undefined','1'),(1240,191,NULL,'2020-03-16 15:27:41','presence','join','adaasadadass','undefined:undefined','1'),(1241,222,NULL,'2020-03-16 15:27:41','presence','join','adaasadadass','undefined:undefined','1'),(1242,222,NULL,'2020-03-16 15:41:12','presence','leave','adaasadadass','undefined:undefined','1'),(1243,191,NULL,'2020-03-16 15:41:12','p