undefined:undefined','1'),(1405,483,NULL,'2020-03-19 21:13:08','text','I have this information from <a href=\"http://rebo4ai.know-center.tugraz.at/bazaar/data/IDSAI/1a_Introduction.pdf\" download=\"http://rebo4ai.know-center.tugraz.at/bazaar/data/IDSAI/1a_Introduction.pdf\">here</a>. But, I\'m not sure I completely understand.','Rebo4AI','undefined:undefined','1'),(1406,483,NULL,'2020-03-19 21:13:08','text','I\'m curious: Is a spam detector now intelligent or not? Why?','Rebo4AI','undefined:undefined','1'),(1407,483,NULL,'2020-03-19 21:14:50','text','IT is because it learns about behaviours and use this knowledge to adapt for other spam.What do you think?','Arnel','undefined:undefined','1'),(1408,483,NULL,'2020-03-19 21:14:56','text','I\'m not sure I understood - which definition of intelligence did you make in deciding that a spam detector is (not) intelligent?','Rebo4AI','undefined:undefined','1'),(1409,483,NULL,'2020-03-19 21:15:27','text','Able to adapt behaviour','Arnel','undefined:undefined','1'),(1410,483,NULL,'2020-03-19 21:15:32','text','Are you personally satisfied with this decision and definition?','Rebo4AI','undefined:undefined','1'),(1411,483,NULL,'2020-03-19 21:15:43','text','No','Arnel','undefined:undefined','1'),(1412,483,NULL,'2020-03-19 21:15:46','text','What would you change in the definition?','Rebo4AI','undefined:undefined','1'),(1413,483,NULL,'2020-03-19 21:16:04','presence','leave','Arnel','undefined:undefined','1'),(1414,483,NULL,'2020-03-19 21:16:04','presence','join','Arnel','undefined:undefined','1'),(1415,483,NULL,'2020-03-19 21:16:55','text','I don&#39;t know','Arnel','undefined:undefined','1'),(1416,483,NULL,'2020-03-19 21:16:58','text','How interesting is it for you to know whether a spam detector is intelligent or not?','Rebo4AI','undefined:undefined','1'),(1417,483,NULL,'2020-03-19 21:17:25','presence','leave','Arnel','undefined:undefined','1'),(1418,483,NULL,'2020-03-19 21:26:58','text','What in your life would change, depending on