anging environment in order to achieve its goals.','Rebo4AI','undefined:undefined','1'),(3054,1078,NULL,'2020-03-24 20:42:27','text','I have this information from <a href=\"http://rebo4ai.know-center.tugraz.at/bazaar/data/IDSAI/1a_Introduction.pdf\" download=\"http://rebo4ai.know-center.tugraz.at/bazaar/data/IDSAI/1a_Introduction.pdf\">here</a>. But, I\'m not sure I completely understand.','Rebo4AI','undefined:undefined','1'),(3055,1078,NULL,'2020-03-24 20:42:27','text','I\'m curious: Is a student now intelligent or not? Why?','Rebo4AI','undefined:undefined','1'),(3056,1078,NULL,'2020-03-24 20:42:49','text','yes, most of them really are ;-) but in any case, i would say every student is intelligent according to the above definitions.','vickie','undefined:undefined','1'),(3057,1078,NULL,'2020-03-24 20:42:53','text','I\'m not sure I understood - which definition of intelligence did you make in deciding that a student is (not) intelligent?','Rebo4AI','undefined:undefined','1'),(3058,1078,NULL,'2020-03-24 20:43:23','text','all of them. mostly, though, the ones about thinking, acting humanly, and being able to adapt behaviour are applicable.','vickie','undefined:undefined','1'),(3059,1078,NULL,'2020-03-24 20:43:29','text','Are you personally satisfied with this decision and definition?','Rebo4AI','undefined:undefined','1'),(3060,1078,NULL,'2020-03-24 20:44:50','text','well, yes...','vickie','undefined:undefined','1'),(3061,1078,NULL,'2020-03-24 20:45:51','text','it is obvious however, that in casual conversation we use intelligent in two manners: being intelligent in principle (like, a table isn&#39;t, humans are per definition); and as differentiating between different degrees of intelligence in humans (so in principle the general intelligence factor, being more or less intelligent; or diligent).','vickie','undefined:undefined','1'),(3062,1078,NULL,'2020-03-24 20:45:53','text','What would you change in the definition?','Rebo4AI','undefined:undefined','1'),(3063,1078,NULL,'2020-03-24 20:46:22','text','i wouldn&#39;t really change something. that was just a comment!','vickie','undefined:undefined','1'),(3064,1078,NULL,'2020-03-24 20:46:29','text','How interesting is it for you to know whether a student is intelligent or not?','Rebo4AI','undefined:undefined','1'),(3065,1078,NULL,'2020-03-24 20:47:02','text','it&#39;s a good reminder that they are all intelligent beings; and also that all students already are relatively successful in their lives: they managed to finish school, and found their way to CS!','vickie','undefined:undefined','1'),(3066,1078,NULL,'2020-03-24 20:47:03','text','What would change in your life depending on whether you see a student as intelligent or not?','Rebo4AI','undefined:undefined','1'),(3067,1078,NULL,'2020-03-24 20:47:34','text','i think it is encouraging to think of students as our bright future. meaning, in general. makes it more enjoyable to teach them.','vickie','undefined:undefined','1'),(3068,1078,NULL,'2020-03-24 20:47:39','text','Interesting! Thanks!','Rebo4AI','undefined:undefined','1'),(3069,1078,NULL,'2020-03-24 20:47:39','text','Until the days!','Rebo4AI','undefined:undefined','1'),(3070,1078,NULL,'2020-03-24 20:47:48','text','??? ;-)','vickie','undefined:undefined','1'),(3071,1078,NULL,'2020-03-24 20:48:18','presence','leave','vickie','undefined:undefined','1'),(3072,1003,NULL,'2020-03-24 22:04:37','presence','leave','sss','undefined:undefined','1'),(3073,1003,NULL,'2020-03-24 22:14:28','presence','join','sss','undefined:undefined','1'),(3074,1003,NULL,'2020-03-24 22:45:22','presence','leave','sss','undefined:undefined','1'),(3075,1003,NULL,'2020-03-25 07:27:11','presence','join','sss','undefined:undefined','1'),(3076,1003,NULL,'2020-03-25 07:27:41','presence','leave','sss','undefined:undefined','1'),(3077,1003,NULL,'2020-03-25 07:28:56','presence','join','sss','undefined:undefined','1'),(3078,1003,NULL,'2020-03-25 08:39:26','presence','leave','sss','undefined:undefined','1'),(3079,1003,NULL,'2