87,1118,NULL,'2020-03-27 01:26:54','presence','join','Rebo4AI','undefined:undefined','1'),(3188,1118,NULL,'2020-03-27 01:26:55','text','Hi, I\'m Rebo4AI; a prototype conversational agent. With me, you can currently discuss only about intelligence. Is that OK with you; do you want to start a conversation?','Rebo4AI','undefined:undefined','1'),(3189,1118,NULL,'2020-03-27 01:27:04','text','Sure. ','Julita','undefined:undefined','1'),(3190,1118,NULL,'2020-03-27 01:27:05','text','In the TUGraz lecture \"<i>Introduction to Data Science and Artificial Intelligence (IDSA)</i>\", different definitions of intelligence have been discussed. According to different definitions, something or someone would be called intelligent if it <b>thinks humanly</b>, <b>acts humanly</b>, <b>thinks rationally</b>, <b>acts rationally</b>; or if it is <b>able to adapt behaviour</b> to a changing environment in order to achieve its goals.','Rebo4AI','undefined:undefined','1'),(3191,1118,NULL,'2020-03-27 01:27:05','text','I have this information from <a href=\"http://rebo4ai.know-center.tugraz.at/bazaar/data/IDSAI/1a_Introduction.pdf\" download=\"http://rebo4ai.know-center.tugraz.at/bazaar/data/IDSAI/1a_Introduction.pdf\">here</a>. But, I\'m not sure I completely understand.','Rebo4AI','undefined:undefined','1'),(3192,1118,NULL,'2020-03-27 01:27:05','text','I\'m curious: Is a dog now intelligent or not? Why?','Rebo4AI','undefined:undefined','1'),(3193,1118,NULL,'2020-03-27 01:28:02','text','It is able to adapt its behaviour to a changing environment to achieve its goals, so it is intelligent. ','Julita','undefined:undefined','1'),(3194,1118,NULL,'2020-03-27 01:28:07','text','Are you personally satisfied with this decision and definition?','Rebo4AI','undefined:undefined','1'),(3195,1118,NULL,'2020-03-27 01:29:53','text','Well... As a pet owner, I&#39;d like to believe that my pet is intelligent.  But I think many people would not agree, since they believe only humans can be intelligent. For them the second part of the definition, after the &quot;or&quot; would be too broad definition of intelligence. ','Julita','undefined:undefined','1'),(3196,1118,NULL,'2020-03-27 01:29:59','text','What would you change in the definition?','Rebo4AI','undefined:undefined','1'),(3197,1118,NULL,'2020-03-27 01:31:03','text','I think most people would agree that &quot;thinks rationally, acts rationally&quot; would be the definition of intelligence. ','Julita','undefined:undefined','1'),(3198,1118,NULL,'2020-03-27 01:31:05','text','How interesting is it for you to know whether a dog is intelligent or not?','Rebo4AI','undefined:undefined','1'),(3199,1118,NULL,'2020-03-27 01:31:55','text','Of course, it is very interesting. Dogs have been our companions forever... ','Julita','undefined:undefined','1'),(3200,1118,NULL,'2020-03-27 01:32:33','text','Which definition would you chose for intelligence?','Julita','undefined:undefined','1'),(3201,1118,NULL,'2020-03-27 01:32:37','text','What would change in your life depending on whether you see a dog as intelligent or not?','Rebo4AI','undefined:undefined','1'),(3202,1118,NULL,'2020-03-27 01:32:58','text','I asked first :-)','Julita','undefined:undefined','1'),(3203,1118,NULL,'2020-03-27 01:33:03','text','Interesting! Thanks!','Rebo4AI','undefined:undefined','1'),(3204,1118,NULL,'2020-03-27 01:33:03','text','Have a nice day and see you soon!','Rebo4AI','undefined:undefined','1'),(3205,1118,NULL,'2020-03-27 01:33:25','text','Oh, sorry. I didn&#39;t mean to offend. It was a simple question.  Bye. ','Julita','undefined:undefined','1'),(3206,1118,NULL,'2020-03-27 02:43:26','presence','leave','Julita','undefined:undefined','1'),(3207,1118,NULL,'2020-03-27 04:19:08','presence','join','Julita','undefined:undefined','1'),(3208,1118,NULL,'2020-03-27 05:07:48','presence','leave','Julita','undefined:undefined','1'),(3209,1089,NULL,'2020-03-27 08:39:54','presence','join','user2','undefined:undefined','1'),(3210,1089,NULL,'2020-03-27 08:39:54','presence'