nce','join','Ilija','undefined:undefined','1'),(3350,1200,NULL,'2020-03-27 18:45:44','presence','join','Rebo4AI','undefined:undefined','1'),(3351,1200,NULL,'2020-03-27 18:45:45','text','Hi, I\'m Rebo4AI; a prototype conversational agent. With me, you can currently discuss only about intelligence. Is that OK with you; do you want to start a conversation?','Rebo4AI','undefined:undefined','1'),(3352,1200,NULL,'2020-03-27 18:45:52','text','Yes','Ilija','undefined:undefined','1'),(3353,1200,NULL,'2020-03-27 18:45:53','text','In the TUGraz lecture \"<i>Introduction to Data Science and Artificial Intelligence (IDSA)</i>\", different definitions of intelligence have been discussed. According to different definitions, something or someone would be called intelligent if it <b>thinks humanly</b>, <b>acts humanly</b>, <b>thinks rationally</b>, <b>acts rationally</b>; or if it is <b>able to adapt behaviour</b> to a changing environment in order to achieve its goals.','Rebo4AI','undefined:undefined','1'),(3354,1200,NULL,'2020-03-27 18:45:53','text','I have this information from <a href=\"http://rebo4ai.know-center.tugraz.at/bazaar/data/IDSAI/1a_Introduction.pdf\" download=\"http://rebo4ai.know-center.tugraz.at/bazaar/data/IDSAI/1a_Introduction.pdf\">here</a>. But, I\'m not sure I completely understand.','Rebo4AI','undefined:undefined','1'),(3355,1200,NULL,'2020-03-27 18:45:53','text','I\'m curious: Is a flower now intelligent or not? Why?','Rebo4AI','undefined:undefined','1'),(3356,1200,NULL,'2020-03-27 18:47:28','text','Yes, it is. A flower adapts its behaviour, for instance when season change. ','Ilija','undefined:undefined','1'),(3357,1200,NULL,'2020-03-27 18:47:31','text','Are you personally satisfied with this decision and definition?','Rebo4AI','undefined:undefined','1'),(3358,1200,NULL,'2020-03-27 18:47:45','text','Yes','Ilija','undefined:undefined','1'),(3359,1200,NULL,'2020-03-27 18:47:51','text','Good to hear that!','Rebo4AI','undefined:undefined','1'),(3360,1200,NULL,'2020-03-27 18:47:51','text','How interesting is it for you to know whether a flower is intelligent or not?','Rebo4AI','undefined:undefined','1'),(3361,1200,NULL,'2020-03-27 18:48:03','text','Not so much','Ilija','undefined:undefined','1'),(3362,1200,NULL,'2020-03-27 18:48:07','text','What would change in your life depending on whether you see a flower as intelligent or not?','Rebo4AI','undefined:undefined','1'),(3363,1200,NULL,'2020-03-27 18:48:19','text','Nothing ','Ilija','undefined:undefined','1'),(3364,1200,NULL,'2020-03-27 18:48:21','text','Interesting! Thanks!','Rebo4AI','undefined:undefined','1'),(3365,1200,NULL,'2020-03-27 18:48:21','text','See you soon!','Rebo4AI','undefined:undefined','1'),(3366,1200,NULL,'2020-03-27 18:48:26','text','Bye ','Ilija','undefined:undefined','1'),(3367,1200,NULL,'2020-03-27 18:48:56','presence','leave','Ilija','undefined:undefined','1'),(3368,1153,NULL,'2020-03-27 19:04:33','presence','leave','s','undefined:undefined','1'),(3369,1186,NULL,'2020-03-27 19:04:33','presence','leave','daa','undefined:undefined','1'),(3370,1186,NULL,'2020-03-27 19:05:24','presence','join','daa','undefined:undefined','1'),(3371,1153,NULL,'2020-03-27 19:05:25','presence','join','s','undefined:undefined','1'),(3372,1186,NULL,'2020-03-27 20:10:59','presence','leave','daa','undefined:undefined','1'),(3373,1186,NULL,'2020-03-27 20:11:15','presence','join','daa','undefined:undefined','1'),(3374,1205,NULL,'2020-03-27 22:41:32','presence','join','u','undefined:undefined','1'),(3375,1205,NULL,'2020-03-27 22:41:33','presence','join','Rebo4AI','undefined:undefined','1'),(3376,1205,NULL,'2020-03-27 22:41:35','text','Hi, I\'m Rebo4AI; a prototype conversational agent. With me, you can currently discuss only about intelligence. Is that OK with you; do you want to start a conversation?','Rebo4AI','undefined:undefined','1'),(3377,1207,NULL,'2020-03-27 22:41:39','presence','join','u','undefined:undefined','1'),(3378,1207,NULL,'2020-03-27 22:41:41','presence','join','R