re</a>.','INFO','undefined:undefined','1'),(5660,1992,NULL,'2020-04-27 16:17:50','INFO','Please discuss together in this chat whether <b>a weather station</b> would be considered intelligent or not. In your reflections, use and refer to the above discussions. Please also consider how satisfied you are with your conclusion; and whether you want to change anything in the definition.','INFO','undefined:undefined','1'),(5661,1992,NULL,'2020-04-27 16:17:50','INFO','When you are finished, you can sign out or have a conversation with our agent, <b>Rebo4AI</b>, by clicking the link in the hint section. ','INFO','undefined:undefined','1'),(5662,1994,NULL,'2020-04-27 16:17:53','presence','join','faee','undefined:undefined','1'),(5663,1994,NULL,'2020-04-27 16:17:53','INFO','In the TUGraz lecture \'Introduction to Data Science and Artificial Intelligence (IDSA)\', different definitions of intelligence have been discussed. According to different definitions, something or someone would be called intelligent if it <strong>thinks humanly, acts humanly, thinks rationally, acts rationally</strong>; or if it is <strong>able to adapt behaviour</strong> to a changing environment in order to achieve its goals. This information is also available <a target=\'_blank\' rel=\'noopener noreferrer\'  href=\'http://rebo4ai.know-center.tugraz.at/bazaar/data/IDSAI/1a_Introduction.pdf\' download=\'http://rebo4ai.know-center.tugraz.at/bazaar/data/IDSAI/1a_Introduction.pdf\'>here</a>.<br><br>Please reflect below on whether <b>Alexa</b> would be considered intelligent or not. In your reflections, use and refer to the above discussions. Please also consider how satisfied you are with your conclusion; and whether you want to change anything in the definition. When you are finished press the submit button, please.','INFO','undefined:undefined','1'),(5664,1990,NULL,'2020-04-27 16:32:47','text','To start the conversation, please welcome Rebo :)','Rebo4AI','undefined:undefined','1'),(5665,1990,NULL,'2020-04